import "./App.scss";
import Navbar from "./components/NavbarComponent";
import Header from "./components/Header";
import SocialMediaBtn from "./components/SocialMediaBtn";
import { Col, Row } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Row className="header">
        <Col>
          <Header />
          <SocialMediaBtn />
        </Col>
      </Row>
      <Row>
        <div>
          <a>test</a>
        </div>
      </Row>
    </div>
  );
}

export default App;
